package com.xiu.jd.bean.ware;

import java.io.Serializable;

public class XiuJdBrand implements Serializable{
	private static final long serialVersionUID = -5503672992019502819L;
	private Integer id;
	private String jdVid;
	private String jdCid;
	private String jdVname;
	private String xiuBrandCode;
	private String xiuBrandName;
	
	private String jdCategoryName ;
	
	public XiuJdBrand() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Integer getId() {
		return id;
	}

	public void setId(Integer id) {
		this.id = id;
	}

	public String getJdVid() {
		return jdVid;
	}

	public void setJdVid(String jdVid) {
		this.jdVid = jdVid;
	}

	public String getJdCid() {
		return jdCid;
	}

	public void setJdCid(String jdCid) {
		this.jdCid = jdCid;
	}

	public String getJdVname() {
		return jdVname;
	}

	public void setJdVname(String jdVname) {
		this.jdVname = jdVname;
	}

	public String getXiuBrandCode() {
		return xiuBrandCode;
	}

	public void setXiuBrandCode(String xiuBrandCode) {
		this.xiuBrandCode = xiuBrandCode;
	}

	public String getXiuBrandName() {
		return xiuBrandName;
	}

	public void setXiuBrandName(String xiuBrandName) {
		this.xiuBrandName = xiuBrandName;
	}

	public String getJdCategoryName() {
		return jdCategoryName;
	}

	public void setJdCategoryName(String jdCategoryName) {
		this.jdCategoryName = jdCategoryName;
	}
	
	

}
